        return this.stMsgHeader.Equals(other.stMsgHeader) && 
        this.eControlType.Equals(other.eControlType) && 
        this.overlayType.Equals(other.overlayType) && 
        this.eType.Equals(other.eType) && 
        this.unTN.Equals(other.unTN) && 
        this.stOverlaySample.SequenceEqual(other.stOverlaySample);
    }

    public override bool Equals(object obj) => this.Equals(obj as MFC_TOPICSAMPLE);

    public override string ToString() => MFC_TOPICSAMPLESupport.Instance.ToString(this);
}

